function buildNestedObject(inputStr, lotStr = "") {
    let part1 = inputStr.substring(10, 13) + inputStr.substring(18, 21);
    let part2 = inputStr.substring(3, 9);
    let part3 = inputStr[20] + inputStr[10] + inputStr[29] + inputStr[23];
    let part4 = inputStr.substring(0, 8);

    //  lot_str
    if (lotStr) {
        let lotPart, lotRes;
        const splitPart = lotStr.split("=");

        if (splitPart.length === 2) {
            lotPart = splitPart[0];
            lotRes = splitPart[1];
        } else {
            lotPart = lotStr;
            lotRes = null;
        }

        const extracted = [];
        const expressions = lotPart.split("+.+");

        expressions.forEach(expr => {
            const matches = [...expr.matchAll(/n\[(\d+(?::\d+)?)\]/g)];
            let segment = "";

            matches.forEach(m => {
                const rule = m[1];
                if (rule.includes(":")) {
                    const [start, end] = rule.split(":").map(Number);
                    segment += inputStr.substring(start, end + 1);
                } else {
                    segment += inputStr[parseInt(rule)];
                }
            });

            extracted.push(segment);
        });

        [part1, part2, part3] = [...extracted, null, null, null].slice(0, 3);
    }

    // 
    return {
        [part1]: {
            [part2]: {
                [part3]: part4
            }
        }
    };
}

